import PromptDark from 'data-base64:~assets/themedCharacters/dark.png';
import PromptGlossy from 'data-base64:~assets/themedCharacters/glossy.png';
import PromptLight from 'data-base64:~assets/themedCharacters/light.png';
import { useTheme } from '~providers/ThemeProvider';

export function Dark() {
  return <img src={PromptDark} alt='dad' width='70' height='70' />;
}

export function Light() {
  return <img src={PromptLight} alt='dad' width='70' height='70' />;
}

export function Win98() {
  return (
    <img
      alt='Chippy Character'
      width='110'
      height='110'
      className='window98-character'
      src='data:image/png;base64,'
    />
  );
}

export function Glossy() {
  return <img src={PromptGlossy} alt='dad' width='70' height='70' />;
}

export function ThemedChippyCharacter() {
  const { theme } = useTheme();
  let icon = <Light />;
  if (theme === 'window98') {
    icon = <Win98 />;
  }
  if (theme === 'dark') {
    icon = <Dark />;
  }

  if (theme === 'glossy') {
    icon = <Glossy />;
  }
  return <div className='chippy-character'>{icon}</div>;
}
